import React, { useState } from "react";
import Container from "./UI/Container";

const users = [];

const RenderUser = (props) => {
  if (users.length <= 1) {
    return <p>No entries found</p>;
  }
  users.push(props);
  console.log(users);
  return <Container></Container>;
};

export default RenderUser;
